// دالة البحث
function searchTable() {
    const searchName = document.getElementById('searchName').value.toLowerCase().trim();
    const results = data.filter(row => row['الاسم'] && row['الاسم'].toLowerCase().includes(searchName));
    const tbody = document.getElementById('resultsTable').getElementsByTagName('tbody')[0];
    tbody.innerHTML = '';

    if (results.length > 0) {
        results.forEach(row => {
            const tr = document.createElement('tr');
            tr.innerHTML = `<td>${row['الرقم الجامعي']}</td>
                            <td>${row['الاسم']}</td>
                            <td>${row['نصفي']}</td>
                            <td>${row['تكاليف']}</td>
                            <td>${row['حضور']}</td>
                            <td>${row['اجمالي']}</td>`;
            tbody.appendChild(tr);
        });
    } else {
        const tr = document.createElement('tr');
        tr.innerHTML = `<td colspan="6">لم يتم العثور على نتائج</td>`;
        tbody.appendChild(tr);
    }
}
